import React from "react";
import { Link } from "react-router-dom";
import logo from "../images/rb_518.png";

const Navbar = () => {
  return (
    <div>
      <nav>
        <div>
          <img src={logo} alt="Logo" className="w-20"></img>
        </div>
        
      </nav>
    </div>
  );
};

export default Navbar;
